import React, { Component } from "react";
import "./SideBar.css";

export class SideBar extends Component {
  render() {
    const { physicians, current } = this.props;
    return (
      <div className="SideBar">
        <div>NOTABLE</div>
        <div>PHYSICIANS</div>
      </div>
    );
  }
}

export default SideBar;
